import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import Pocetna from './pages/Pocetna/Pocenta';
import Proizvodi from './pages/Proizvodi/Proizvodi';
import PrijavaStete from './pages/PrijavaStete/PrijavaStete';
import OnlinePolisa from './pages/OnlinePolisa/OnlinePolisa';
import ONama from './pages/ONama/ONama';
import Poslovnice from './pages/Poslovnice/Poslovnice';

import NoMatch from './pages/NoMatch/NoMatch';
import TopNav from './components/TopNav/TopNav';
import Navigation from './components/Navigation/Navigation';

export default class App extends Component {
	render() {
		return (
			<React.Fragment>
				<TopNav />
				<Navigation />
				<Switch>
					<Route exact path="/" component={Pocetna} />
					<Route exact path="/proizvodi" component={Proizvodi} />
					<Route exact path="/prijava-stete" component={PrijavaStete} />
					<Route exact path="/online-polisa" component={OnlinePolisa} />
					<Route exact path="/o-nama" component={ONama} />
					<Route exact path="/poslovnice" component={Poslovnice} />

					<Route exact path="/vijesti" component={Vijesti} />
					<Route exact path="/kontakt" component={Kontakt} />
					<Route component={NoMatch} />
				</Switch>
			</React.Fragment>
		);
	}
}
